import React from "react";
import ReactDOM from "react-dom";

const flname = "Vipin Pathak";

ReactDOM.render(
  <>
    <h1>My name is {flname}</h1>
    <p>Hello World {Meth.random()}</p>
  </>
  , document.getElementById("root"));
